@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent {

}
<div class="container">
    <h2>Bienvenido a la Gestión de Carritos Médicos</h2>
    <p>
      Esta aplicación te permite gestionar el transporte de medicamentos mediante carritos médicos.
      Puedes realizar solicitudes, crear carritos y más.
